//import "./Hero.css";

const Hero = () => {
  return (
    <>
    <div className = "hero">
      <img alt="Heroimage" src="https://images.unsplash.com/photo-1679215805580-8f5946098bf1?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHwzfHx8ZW58MHx8fHw%3D&auto=format&fit=crop&w=700&q=60"/>
    </div>
    </>
    )
}

export default Hero
